import styled from "styled-components"

const HeaderContainer = styled.header`
    display: flex;
    justify-content: space-around;
    width: 100vw;
    height: 50px;
    background: linear-gradient(65deg, #00652e 35%, #00652ed1);
    align-items: center;
    color: #fff;
`;

const Header = () => {
    return(
        <>
        <HeaderContainer>
        <h1>Test Header</h1>
        </HeaderContainer>
        </>
    )
}
export default Header;
